import callNYT from './background/background'
function App() {
  return (
    <div>
      
        <h1>Hello, this is your extension!</h1>
        <button id="myButton" onTogg={callNYT()}>Click me</button>
        <script type="module" src="background.js"></script>
      
    </div>
  );
}

export default App;
